import { SelectSinglePlayerData } from "../../store/getPlayerSlise";
import { useAppSelector } from "../../store/hooks";
import s from "./style.module.css";

const PlayerInfo: React.FC = () => {
  const singlePlayer = useAppSelector(SelectSinglePlayerData);
  console.log("singlePlayer: ", singlePlayer);
  return (
    <>
      <div className={s.photo}></div>
      <div className={s.info}>
        <div className={s.title}>
          Greg Whittington <span className={s.number}>#22</span>
        </div>
        <ul className={s.list}>
          <li>
            <p className={s.name}>Position</p>
            <span className={s.desc}>Forward</span>
          </li>
          <li>
            <p className={s.name}>Team</p>
            <span className={s.desc}>Denver Nuggets</span>
          </li>
          <li>
            <p className={s.name}>Height</p>
            <span className={s.desc}>206 cm</span>
          </li>
          <li>
            <p className={s.name}>Weight</p>
            <span className={s.desc}>95 kg</span>
          </li>
          <li>
            <p className={s.name}>Age</p>
            <span className={s.desc}>27</span>
          </li>
        </ul>
      </div>
    </>
  );
};

export default PlayerInfo;
